// Dependencies.
import { Link } from "react-scroll";
import React from 'react';

// Component 'Navbar'.
function Navbar() {
    return (
        // Navbar Container.
        <nav class="navbar navbar-expand-lg navbar-dark bg-steel">
            {/* Navbar Brand */}
            <a id="MainNavBrand" class="navbar-brand" href="/">Shawn Luther</a>
            {/* Mobile Collapse Icon (Hamburger) */}
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText"
                aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                {/* Hamburger Icon */}
                <span class="navbar-toggler-icon"></span>
            </button>
            {/* Navbar Mobile Collapse Container */}
            <div class="collapse navbar-collapse" id="navbarText">
                {/* Navbar Social Circles */}
                <div id="ContainSocialCircles">
                    {/* Social Circles Brand */}
                    <h1 className="text-info font-weight-bold">My Social Circles</h1>
                    {/* GitHub Circle */}
                    <div className="social-github">
                    <i class="fa fa-github"></i>
                    </div>
                </div>
                <ul id="SiteNavLinks" class="navbar-nav ml-auto nav-flex-icons">
                    {/* Item #1 - 'About Me' */}
                    <li class="nav-item hvr-grow">
                        <a class="nav-link" href="#">
                            <span className="text-info">&#123; </span>
                            <i class="fa fa-user" aria-hidden="true"></i> About Me
                            <span className="text-info"> &#125; </span>
                        </a>
                    </li>
                    {/* Item #2 - 'Skills & Projects' */}
                    <li class="nav-item hvr-grow">
                        <a class="nav-link" href="#">
                            <span className="text-info">&#123; </span>
                            <i class="fa fa-code" aria-hidden="true"></i> Skills &#38; Projects
                            <span className="text-info"> &#125; </span>
                        </a>
                    </li>
                    {/* Item #3 - 'Contact Info' */}
                    <li class="nav-item hvr-grow">
                        <a class="nav-link" href="#">
                            <span className="text-info">&#123; </span>
                            <i class="fa fa-address-book"></i> Contact Info
                            <span className="text-info"> &#125; </span>
                        </a>
                    </li>
                </ul>
            </div>
        </nav>
    );
}

// Do export.
export default Navbar;
